Verenigde Staten
Actie / Drama
131 minuten

geregisseerd door Roland Emmerich
met Channing Tatum, Jamie Foxx en Maggie Gyllenhaal

Het Witte Huis in de Verenigde Staten wordt overvallen en bezet door een gevaarlijke paramilitaire groep. 
Een agent van de geheime dienst, John Cale (Channing Tatum), krijgt de belangrijke en zware taak om het leven van de Amerikaanse president te redden.



